import React from 'react'
import cl from './styled.module.css'
import { Link, NavLink } from 'react-router-dom'
export default function About() {
  return (
    <>
      <div className={cl.storyWrapper}>
        <p className={cl.links}><NavLink className={({ isActive }) => isActive ? 'activeLink' : ''} to={'/about'}>Home</NavLink> / <NavLink className={({ isActive }) => isActive ? 'activeLink' : ''} to={'/about'}>About</NavLink></p>
      </div>
    </>
  )
}
